import React from 'react';

function List() {
    return (
        <ol>
            <li>Aman</li>
            <li>Tiwari</li>
            <li>Tiwari</li>
            <li>Tiwari</li>
            <li>Tiwari</li>

        </ol>

    );
}

export default List;
